import React from 'react';
import { Link } from 'react-router-dom';

const Card = ({ products }) => {
  return (
    <div className="grid grid-cols-2 gap-4">
      {products.map((product, index) => (
        <div key={index} className="bg-white p-4 rounded shadow-lg flex items-center rounded-xl bg-slate-50">
          {/* Product Image */}
          <div className="w-1/3 pr-4">
            <img src={product.productImage} alt="Product" className="w-full h-auto" />
          </div>

          {/* Product Details */}
          <div className="flex-1">
            <h2 className="text-lg font-bold mb-2">{product.productName}</h2>
            <p className="text-sm text-gray-600 mb-2">Category: xxxxxxxxxxxxxxxxxxxxx</p>
            <p className="text-sm text-gray-800">{product.productPrice}</p>
            <p className="text-sm text-gray-800">
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. 
              Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.
            </p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Card;
